import React, { useEffect, useRef } from "react";
import * as d3 from "d3";

const HierarchicalGraph = ({ jsonData, setHoveredCoordinates }) => {
  const graphRef = useRef(null);

  useEffect(() => {
    if (!jsonData || jsonData.length === 0) return;

    const coordinateKeys =
      jsonData.length > 0
        ? Object.keys(jsonData[0]).filter(
            (key) => key !== "Cluster" && key !== "Bead"
          )
        : [];
    if (coordinateKeys.length === 0) return;

    const assignBitVector = (point) =>
      coordinateKeys
        .map((key) => (key in point && point[key] >= 0 ? "1" : "0"))
        .join("");

    const nodes = jsonData.map((point, index) => ({
      id: `point-${index}`,
      ...point,
      bitVector: assignBitVector(point),
    }));

    const container = d3.select(graphRef.current.parentNode);
    const width = container.node().getBoundingClientRect().width;
    const height = container.node().getBoundingClientRect().height;

    const svg = d3
      .select(graphRef.current)
      .attr("width", width)
      .attr("height", height)
      .attr("viewBox", `0 0 ${width} ${height}`)
      .attr("preserveAspectRatio", "xMidYMid meet");

    svg.selectAll("*").remove();

    const size = Math.min(width, height);
    const centerX = width / 2;
    const centerY = height / 2;

    const squarePadding = 20;
    const squareSizes = Array.from(
      { length: coordinateKeys.length },
      (_, i) =>
        size / 2 - i * (squarePadding + size / (2 * coordinateKeys.length))
    );

    svg
      .append("g")
      .selectAll("rect")
      .data(squareSizes)
      .enter()
      .append("rect")
      .attr("x", (d) => centerX - d / 2)
      .attr("y", (d) => centerY - d / 2)
      .attr("width", (d) => d)
      .attr("height", (d) => d)
      .attr("fill", "none")
      .attr("stroke", "#ddd")
      .attr("stroke-width", 1);

    const getRandomPointInSquare = (squareSize) => {
      const halfSize = squareSize / 2;
      return [
        centerX - halfSize + Math.random() * squareSize,
        centerY - halfSize + Math.random() * squareSize,
      ];
    };

    svg
      .append("g")
      .selectAll("circle")
      .data(nodes)
      .enter()
      .append("circle")
      .attr("r", 5)
      .attr("cx", (d) => {
        const dimensionIndex = Math.max(
          0,
          d.bitVector.replace(/0/g, "").length - 1
        );
        if (dimensionIndex >= squareSizes.length) return centerX; // Fallback
        const [x] = getRandomPointInSquare(squareSizes[dimensionIndex]);
        return x;
      })
      .attr("cy", (d) => {
        const dimensionIndex = Math.max(
          0,
          d.bitVector.replace(/0/g, "").length - 1
        );
        if (dimensionIndex >= squareSizes.length) return centerY; // Fallback
        const [, y] = getRandomPointInSquare(squareSizes[dimensionIndex]);
        return y;
      })
      .attr("fill", "blue")
      .on("mouseover", (event, d) => {
        setHoveredCoordinates({
          ...d,
          bitVector: d.bitVector,
        });
      })
      .append("title")
      .text((d) => `ID: ${d.id}\nBit Vector: ${d.bitVector}`);
  }, [jsonData, setHoveredCoordinates]);

  return <svg ref={graphRef} style={{ width: "100%", height: "100%" }}></svg>;
};

export default HierarchicalGraph;
